import Copyrigtht from "../atoms/Copyright";

export default class MeetupNow extends React.Component {
	constructor(){
		super()
		this.state = {
			name: `Hacktiv8`,
			year: `2018`,
		};
	}
	render() {
		return (
		<footer>
			<br/><br/>
			<hr className="mx-10"/>
			<br/><br/>
			<div className="flex">
				<Copyrigtht name = {this.state}/>
			</div>
			<br/><br/>
		</footer>
		)
	}
	
}


